    <style type="text/css">a, a > code {
color: rgb(249, 38, 114);
text-decoration: none;
}
.footnote {
position: absolute;
bottom: 3em;
padding-right: 4em;
font-size: 90%;
}
.remark-code-line-highlighted { background-color: #ffff88; }
.inverse {
background-color: #272822;
color: #d6d6d6;
text-shadow: 0 0 20px #333;
}
.inverse h1, .inverse h2, .inverse h3 {
color: #f3f3f3;
}

.left-column {
color: #777;
width: 20%;
height: 92%;
float: left;
}
.left-column h2:last-of-type, .left-column h3:last-child {
color: #000;
}
.right-column {
width: 75%;
float: right;
padding-top: 1em;
}
.pull-left {
float: left;
width: 47%;
}
.pull-right {
float: right;
width: 47%;
}
.pull-right + * {
clear: both;
}
img, video, iframe {
max-width: 100%;
}
blockquote {
border-left: solid 5px lightgray;
padding-left: 1em;
}
.remark-slide table {
margin: auto;
border-top: 1px solid #666;
border-bottom: 1px solid #666;
}
.remark-slide table thead th { border-bottom: 1px solid #ddd; }
th, td { padding: 5px; }
.remark-slide thead, .remark-slide tfoot, .remark-slide tr:nth-child(even) { background: #eee }
@page { margin: 0; }
@media print {
.remark-slide-scaler {
width: 100% !important;
height: 100% !important;
transform: scale(1) !important;
top: 0 !important;
left: 0 !important;
}
}
</style>

## Au quoditien
Notre quotidien est baign par les donnes.

--

- Dans la sphre *intime*, notre consommation nergtique est transmise  notre fournisseur d&#39;lectricit, nos revenus sont dclars sur des feuilles d&#39;imposition. Nous donnons des informations personnelles via les mails que nous changeons, recevons. Des donnes transitent au sujet des achats que nous ralisons sur Internet et sur le montant et la nature de nos transactions bancaires.

--

- Dans la sphre *professionnelle*, nous changeons des courriels, exploitons des documents, des tableaux, remplissons des formulaires sur applications web mtier.

## A quoi ressemble une donne ?

Une spcialiste de la donne en donne une description assez originale :
&gt;Il s&#39;agit d&#39;une masse abstraite de nombres, sans poids et non identifie (la plupart du temps encode numriquement), ayant une influence puissante sur nos vies.

Concrtement, ces donnes nous apparaissent structures au travers de tableaux, de tables de donnes.

class: middle

Le courant du Big Data suit celui de l&#39;accroissement :

- des *flux*

--

- des capacits de *stockage* des donnes

--

- des capacits de *calcul* des ordinateurs

---
## Flux
L&#39;accroissement des flux de donnes concerne par exemple celui des rseaux de tlphonie mobile, de l&#39;internet, qui permettent tout un tas d&#39;applications telles que la tlmdecine, l&#39;information en temps rel pour les agriculteurs, d&#39;autres modalits de travail (tltravail),....

Les donnes circulent entre des machines soit via les airs, en particulier via les ondes via les satellites et antennes mettrices, soit via des cbles comme la fibre optique.

&lt;center&gt;&lt;img src=https://upload.wikimedia.org/wikipedia/commons/4/49/Fibreoptic.jpg width=50%&gt;&lt;/img&gt;&lt;/center&gt;

---

## Stockage
L&#39;augmentation du stockage des donnes est une des plus grandes caractristiques du big data. Celle-ci permettra de dmatrialiser de plus en plus de donnes, et en corollaire des procdures, telles que les dclarations d&#39;impt.

Les donnes sont stockes sur des supports tels que les disques durs, des cls USB  usage souvent personnel. Mme loges dans le cloud, les donnes sont sur ces supports.

&lt;center&gt;&lt;img src=https://upload.wikimedia.org/wikipedia/commons/thumb/d/de/Fc-disk.jpg/640px-Fc-disk.jpg width=50%&gt;&lt;/img&gt;&lt;/center&gt;

---

## Calcul
Les ordinateurs sont dots de capacits de calcul allant grandissant (loi de Moore).

Les calculs, sur un ordinateur, sont raliss grce aux **processeurs**, parfois aussi grce  la carte graphique, sur la base d&#39;une binarisation de l&#39;information. Ceci, en attendant l&#39;arrive de l&#39;ordinateur quantique qui considrera des tats intermdiaires (ou plutt simultans) entre le 0 et 1.

Les **algorithmes** sont des squences ordonnes d&#39;oprations informatiques. Ils automatisent le traitement de masses d&#39;information et parfois en rvlent des motifs. Certains de ces algorithmes appels rseaux de neurones miment mme le fonctionnement du cerveau humain et sont en plein dveloppement (intelligence artificielle).

## L&#39;cosystme de la donne

### La chane des donnes
La chane des donnes se compose des tpaes suivantes :
- produire

--
- mettre en circulation

--
- ouvrir

--
- rutiliser

--
- gouverner

---
### Les acteurs
Dans l&#39;cosystme de la donne, on distingue plusieurs acteurs :

- les **producteurs** de donnes qui gnrent des donnes, de faon active ou pas (capteurs)

--

- les **collecteurs** qui rassemblent les donnes mises sur le web

--

- les **administrateurs** qui classent et documentent la donne collecte

--

- les **rutilisateurs** qui exploitent, &quot;font parler&quot; les donnes

--

- les **contributeurs** qui, le plus souvent de leur propre fait, participent  l&#39;alimentation d&#39;une base de donnes (comme wikipedia)

## La Smart City ou ville intelligente

La Smart City, ou ville intelligente, est une ville dans laquelle de multiples **capteurs**, voire des **donnes issues des tlphones des citoyens**, remontent  un sige central des informations sur la ville : congestion routire, pollution de l&#39;air, consommation nergtique, ...

On lui appose le prfixe *smart* car elle est cense s&#39;adosser, pour diriger ses oprations, sur la **synthse de donnes** factuelles varies, prsentes en trs grand nombre.

L&#39;objet de la Smart City est de crer une cit harmonieuse quasiment autogre par les algorithmes et les donnes captes et mises par le rseau.

Le compteur Linky peut tre considr comme une brique possible de la smart city puisque ce dernier est un lment des *smart grids*, rseaux d&#39;lectricit capables de rguler localement le dbit d&#39;lectricit en fonction de l&#39;tat des diffrents noeuds du rseau.

## L&#39;individu base de donnes
Un citoyen connect  internet alimente, parfois sans le savoir, les bases de donnes de socits ayant monopole sur le rseau. Les donnes qu&#39;il met peuvent concerner :

--

- Tout d&#39;abord, ses **envies**, ses dsirs, ses besoins et ses interrogations, par le biais d&#39;un moteur de recherche tel que Google.

--

- Les **informations personnelles** partages sur un rseau social comme Facebook ou bien Gmail.

--

- Sa **localisation**, s&#39;il a activ le GPS de son smartphone

--

- Ses **gots**, notamment musicaux, s&#39;il se connecte  Spotify ou a command des disques sur Amazon.

---

Le citoyen est tellement connect et parfois si mal inform que des donnes personnelles chappent  sa vigilance et sont transmises  des tiers. Les consquences en cascade de ces fuites peuvent largement s&#39;tendre hors de sa sphre intime.

En l&#39;occurrence, peu de personnes lisent les *Conditions Gnrales d&#39;Utilisation* d&#39;applications Internet avant de les approuver.

## Impact des donnes
### Pour ceux qui s&#39;intressent aux citoyens
L&#39;essor d&#39;internet et de ses grands groupes est intimement li  l&#39;accs aux donnes personnelles des individus, d&#39;o le fait de qualifier les donnes comme de l&#39;*or noir du XXIe sicle*.

Les GAFA et BATX en tirent bnfice en **personnalisant** les pubs que nous recevons et en recueillant des informations au sujet de nos envies et prfrences.

**Les donnes individuelles sont prcieuses pour les villes intelligentes**. En effet, la cohrence des dcisions prises par l&#39;ordinateur central dpendra de la qualit, de la fracheur et de la frquence des donnes recueillies auprs des individus eux-mmes ou de l&#39;environnement plus ou moins proche de ces derniers : immeuble, bloc, quartier, ville,...

### Pour les citoyens qui s&#39;intressent  la socit ou  leur environnement
Enfin, la livraison de donnes est un des lments de la dmocratie o les citoyens ont le **droit d&#39;avoir accs**  certaines dcisions publiques, aux budgets.

De plus en plus, l&#39;ouverture des donnes confre aux pays, voire, aux collectivits qui la mettent en oeuvre, un caractre d&#39;**exemplarit**.

Nous le verrons plus tard : les donnes, lorsqu&#39;elles sont ouvertes, permettent mme de voir fleurir des entreprises qui btissent des services bass sur leur exploitation. **L&#39;ouverture des donnes dynamise l&#39;conomie**.

## Protection des donnes
### CNIL
La Commission Nationale de l&#39;Informatique et des Liberts est une autorit administrative franaise charge de veiller  ce que l&#39;informatique soit au service du citoyen et **qu&#39;elle ne porte atteinte ni  l&#39;identit humaine, ni aux droits de l&#39;Homme, ni  la vie prive, ni aux liberts individuelles ou publiques**.

### RGPD
Face au commerce lucratif des **donnes personnelles** ralis parfois  l&#39;insu des utilisateurs et la sensibilit de certaines donnes  caractre personnel, l&#39;Union Europenne s&#39;est dote cette anne du Rglement Gnral sur la Protection des donnes (RGPD)

---

## La culture des donnes ou Data Literacy

Ce n&#39;est pas parce qu&#39;une donne est en libre accs qu&#39;elle est accessible.

L&#39;accs et l&#39;exploitation des donnes est **souvent l&#39;affaire de spcialistes de la donne** alors que le contenu de celles-ci est cens intresser tout le monde.

Afin de se dpartir d&#39;une vision litiste de la donne, la Data Literacy (Littratie des donnes, ou plus simplement la culture de la donne), a pour but d&#39;amener  s&#39;intresser aux donnes des personnes non-spcialistes.

Cela passe par la **formation**, la **sensibilisation** des individus.
